# Memory Usage: 17.3 MB, less than 20.82% of Python3 online submissions for Number of Matching Subsequences.
# https://leetcode.com/problems/number-of-matching-subsequences/discuss/1289406/Python-binary-search-solution-explained
class Solution:
    def numMatchingSubseq(self, s: str, words: List[str]) -> int:

        places = defaultdict(list)
        for i, c in enumerate(s):
            places[c].append(i)

        def is_subsequence(w: str) -> bool:
            nonlocal places
            curr = 0
            for c in w:
                i = bisect_left(places[c], curr)
                if i >= len(places[c]):
                    return False
                curr = places[c][i] + 1
            return True

        return sum(is_subsequence(w) for w in words)

